import React from "react";
import { useRouter } from "next/router";
import NavBar from "../../components/Navbar/Navbar";
import { useShirt } from "../../lib/reactQueryHooks";

const ProductItem = () => {
  const {
    query: { id },
  } = useRouter();
  const { data, error, isValidating } = useShirt(id);
  return (
    <div>
      <NavBar />
      {isValidating ? (
        <p>Loading</p>
      ) : (
        <>
          {data.map((shirt) => {
            return <>shirt.name</>;
          })}
        </>
      )}
      Esta es la pagina del producto : {id}
    </div>
  );
};

export default ProductItem;
